import React from 'react';
import './WorksCited.css'; // Import your CSS file

const WorksCited: React.FC = () => {
  return (
    <div className="works-cited">
      <h1>Works Cited</h1>

      <div className="citation">
        <p>
          Author Last Name, Author First Name. "Title of the Work." <em>Title of the Overall Website</em>, Publisher,
          Publication Date, URL.
        </p>
      </div>

      {/* Add more citations as needed */}

      <div className="footer">
        <p>Note: This is a sample Works Cited page. Follow the MLA format guidelines for your specific sources.</p>
      </div>
    </div>
  );
};

export default WorksCited;
